  [],\n\t\"num_tags\": 0,\n\t\"name\": \"ghrsst-level-2p-global-skin-sea-surface-temperature-from-the-advanced-along-track-scanning-radia59b3\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Launched in March 2002 by the European
  Space Agency (ESA), Envisat is the largest Earth Observation spacecraft ever built.
  It carries ten sophisticated optical and radar instruments to provide continuous
  observation and monitoring of the Earth's land, atmosphere, oceans and ice caps.
  The Advanced Along-Track Scanning Radiometer (AATSR) onboard the Envisat spacecraft
  is designed to meet the challenging task of monitoring and detecting the climate
  change signal of sea surface temperature (SST). It builds on the success of its
  predecessor instruments on the European Remote-Sensing Satellite (ERS)-1, and ERS-2
  satellites, and will lead to a multi-decade record of precise and accurate global
  SST measurements, thereby making a valuable contribution to the long-term climate
  record. The exceptionally high radiometric accuracy and stability of AATSR data
  are achieved through a number of unique features. A comprehensive pre-launch calibration
  programme, combined with continuous in-flight calibration, ensures that the data
  are continually corrected for sensor drift and degradation. A \"dual-view\" algorithm
  offering improved atmospheric correction by applying two different atmospheric path
  lengths is used to derive the SSTskin observations. The accuracies achieved with
  this configuration are further enhanced by using low-noise infrared detectors, cooled
  to their optimum operating temperature by a pair of Stirling-cycle coolers. With
  its high-accuracy, high-quality imagery and channels in the visible, near-infrared
  and thermal wavelengths, AATSR data will support many applications in addition to
  oceanographic and climate research, including a wide range of land-surface, cryosphere
  and atmospheric studies. See Llewellyn-Jones et al (2001) ESA bulletin 105, Feb
  2001 for a full description. These AATSR L2P SST data are produced as part of the
  Group for High Resolution Sea Surface Temperature (GHRSST) Project according to
  the GHRSST-PP Data Processing Specification (GDS) version 1.5. This AATSR L2P dataset
  is the original product produced by the Medspriation Regional Data Assembly Facility
  (RDAC) from early 2005 to mid 2009.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
